7369356631886368031	Jen	\N	Lemon raspberry white chocolate muffins✨🍰                                                                 Recipe:                                                                    Raspberry Syrup -1 1/4 cup raspberries (fresh or frozen) -1/4 cup sugar (50g) -2 Tbsp water -1 tsp lemon juice -1/2 Tbsp cornstarch + 1 Tbsp water Crumble -1/2 cup sugar (100g) -1/2 cup all-purpose flour (60g) -1/4 cup unsalted butter, cold and diced (57g) -pinch of salt Raspberry Muffins -2 1/4 cups all-purpose flour (270g) -1 cup granulated sugar (198g) -2 tsp baking powder  -1/2 tsp salt -1 Tbsp lemon zest -2 eggs, room temperature -2/3 cup milk (158ml) -1 1/2 tsp vanilla  -1/4 cup vegetable oil (59ml) -1/4 cup unsalted butter, melted and cooled (57g) -1/2 cup white chocolate chips  -1 1/2 cups raspberries (fresh or frozen) Instructions: For the raspberry syrup: 1. Combine 1 Tbsp of water and cornstarch in a small dish and set aside.  2. In a medium saucepan bring water, sugar, and raspberries to a boil. Stir occasionally. Reduce heat and simmer for about 10 minutes.  3. Add the lemon juice and water+starch mixture and mix to combine. Turn off heat and set aside to cool. For the crumble:  1. Stir together 1/2 cup flour, 1/2 cup sugar, and a pinch of salt.  2. Add 1/4 cup unsalted butter diced into cubes and work the butter into the flour mixture with your fingers until a crumbly mixture has formed. Set aside. For the muffins: 1. In a medium bowl add the flour, sugar, baking powder, and salt. Whisk together and set aside.  2. In a large bowl add the milk, eggs, vanilla, melted butter, vegetable oil, and lemon zest. Whisk until fully combined. 3. Fold the dry ingredients in the wet ingredients until just combined. 4. Fold in the raspberries and white chocolate chips. 5. Line a 12-cup muffin tin with cupcake liners, and fill with batter. (I did 6 jumbo muffins) 6. Add the raspberry syrup on top of the muffins and sprinkle the crumble before baking. 7. For 12 regular sized muffins bake at 425°F for 5 minutes, then reduce to 350°F for 15-18 minutes. For jumbo muffins bake at 425°F for 5 minutes, then reduce to 350°F for 25-30 minutes. #raspberry #lemon #whitechocolate #muffins #baking #recipe #bakingtiktok #bakingvideo #dessert #foryou #bakingtherapy #baketok #fyp 	raspberry, lemon, whitechocolate, muffins, baking, Recipe, bakingtiktok, bakingvideo, dessert, foryou, bakingtherapy, baketok, fyp	https://my-tiktok-videos-bucket.s3.amazonaws.com/7369356631886368031.mp4	\N	1100000	1403	56100	11100000	382700	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/8b4c532f097d631f8bf2a5ed3490c8ea~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=47138&refresh_token=ea3f78ecabb08823a975ffceaeb64717&x-expires=1725645600&x-signature=5tDBw3adm4%2BkMx6PD7B%2BbvVhmE4%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/8b4c532f097d631f8bf2a5ed3490c8ea~c5_720x720.jpeg?lk3s=a5d48078&nonce=39140&refresh_token=4bc8188919878bffa92bc3be2b01a0d1&x-expires=1725645600&x-signature=tdk%2B5oDcTwmDs4rtm0tWd6zLzU4%3D&shp=a5d48078&shcp=b59d6b55	0	0	0	0	0	0	2024-05-15 22:30:09	\N
