7330125499508804906	Nicole K. Modic	\N	The one recipe of mine you NEED to make, ONE PAN MARRY ME CHICKEN ORZO. Life changing! 1.5 lbs boneless, skinless chicken breast, cut up into cubes 2 tb olive oil 4-5 cloves garlic, mashed 3/4 cup sun-dried tomatoes, in oil, drained 2 tsp italian seasoning 2 tsp paprika 1/2 tsp kosher salt 1 tsp ground black pepper 1 cup orzo 2 3/4 cups chicken broth (or water) 3/4 cup full fat coconut milk or heavy cream 2 large handfuls fresh spinach 3/4 cup parmesan cheese, freshly grated Pat chicken dry and cut into cubes. Add olive oil to a large, deep skillet over medium-high heat. Once the pan is hot, add the chicken. Stir and cook for 2-3 minutes until the edges start to cook. Add in the sun dried tomatoes, garlic, italian seasoning, paprika, salt & black pepper. Cook for 3-4 minutes more, then add the orzo and broth and stir well. Reduce heat to medium. Cover the skillet and cook for 12 minutes, removing the cover every few minutes to stir and ensure nothing sticks to the bottom of the pan. Once the orzo is cooked through, add the coconut milk/cream and spinach and stir another minute until the spinach is wilted, then add in the parmesan cheese and stir once more. Remove from heat, plate and enjoy!   #20minutedinner #easyrecipes #marrymechicken #valentinesdaydinner #easydinner 	20minutedinner, EasyRecipes, marrymechicken, valentinesdaydinner, easydinner	https://my-tiktok-videos-bucket.s3.amazonaws.com/7330125499508804906.mp4	\N	93700	299	33700	5100000	107800	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/d64e06a917422e1acf7e9d10781d750c~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=88324&refresh_token=85a5e719c336988a16982fa994045730&x-expires=1725645600&x-signature=t7%2B5aSwN3AR7m9FWz9Ly0MVH7bo%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/d64e06a917422e1acf7e9d10781d750c~c5_720x720.jpeg?lk3s=a5d48078&nonce=1202&refresh_token=2392660413f91f16c33deb3ee465eb33&x-expires=1725645600&x-signa