7404198121607154986	Shredhappens	\N	MEDITERRANEAN FETA SALAD . This is one of those incredible salads that packs the perfect texture and flavor with every bite. And a dressing so fragrant you’re going to want to put it on everything. . As always, feel free to make whatever substitutes you like - these are just my starting point, so feel free to use it as your own canvas and go from there! . Here is how I made it: . 1.For the base, I used a container of peppery baby arugula. About 5oz. . 2.To the base of arugula, add 3 finely diced Persian cucumbers, 1 cup of sliced baby heirloom tomatoes (I just cut these in half), 1/3 of a finely diced red onion, two very large handfuls of fresh flat leaf parsley finely and roughly chopped. And finely, one handful of fresh mint, finely chopped. The herbs add a ton of flavor here. . 3.To elevate this further, lets add three superstar ingredients. I diced up about 1/3 cup black cured olives - you can use kalamata, too, but these are my favorite for this recipe, 1/3 cup of toasted and cooled walnuts (I just toast these in a pan on the stovetop, let them cool, then chop finely), and 2 blocks of feta cheese to crown this up. . 4.And finally, the dressing. Grab a small food processor or blender. Add 1/3 cup of a GOOD olive oil, the juice of 1 large lemon, a small pinch of sea salt (dont overdo it since the feta is salty), a generous amount of fresh cracked pepper, 2 garlic cloves, 1 tablespoon Aleppo pepper, the zest of 1 large orange (this is where you will get a stunning aroma that will really take this salad to the top. . 5.Process the dressing well, give it a taste, and adjust however way you wish. I like mine lemony, so i almost always add a little more lemon juice. But you do you. . Toss the salad well, and devour. You can enjoy this as is, or with your favorite protein - chicken, shrimp, or a piece of white fish would go great, but its pretty versatile. . ENJOY! If you make this, be sure to let me know on SHREDHAPPENS. I love seeing your dishes and hearing from you. . . . . #lowcarb #lowcarbrecipes #salad #saladrecipe #keto #ketorecipes #healthyrecipes #whatsonmyplate #goodmoodfood #mediterraneanfood #mediterraneanlife 		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7404198121607154986.mp4	\N	5867	23	802	214600	\N	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=92421&refresh_token=d15ef0f59526e90be5e65d40c4c01532&x-expires=1726106400&x-signature=nv9%2BGpagGDGPly%2FsvFh5Ts%2BBL%2BI%3D&shp=a5d48078&shcp=b59d6b55	\N	\N	\N	\N	\N	\N	\N	\N	\N
