7320666648896097537	sohonutrition	\N	CREAMY CHICKEN 🤤 A delicious, healthy high protein meal for you to try. Save for later ☝🏼 •481 kcals •39g PRO, 63g CHO, 15g FAT Serves 2 -200g of uncooked chicken breast -500g of potato -2 tsp of garlic salt -Broccoli/broccolini  -1 red onion -2 cloves of garlic -50ml of double cream -1 reduced salt chicken stock cube mixed with 300ml of boiling water (use more water if needed) -1 heaped tsp of Dijon mustard -Fresh parsley, chopped -Salt/pepper Method: 1. Wash the potatoes and slice into wedges (I like to leave the skin on). Par boil for 5 minutes. Season with garlic salt and pepper. Air fry for 25-30 mins until soft. 2. Boil the broccoli until soft. 3. Beat down the chicken before frying. Season with paprika, salt and pepper. 4. Spray a pan with oil and add the chicken breasts. Cook on either side for 5-10 minutes. Remove from the pan and set aside. 5. One the same pan, add a drop of water. Then add the garlic and red onion. Stir and let simmer for 2 minutes.  6. Pour in the chicken stock and double cream. Mix in the Dijon mustard. Add the chopped parsley. Let it simmer again before adding back in the cooked chicken. 7. Coat each side of the chicken in the sauce.  8. Serve the potatoes, chicken, sauce and vegetables into two portions. Enjoy! #creamychicken #potatoes #garlicpotatoes #easyrecipes #healthyfood #highproteinrecipes #foryou #foryoupage 	creamychicken, potatoes, garlicpotatoes, EasyRecipes, healthyfood, highproteinrecipes, foryou, foryoupage	https://my-tiktok-videos-bucket.s3.amazonaws.com/7320666648896097537.mp4	\N	327600	554	41200	12300000	235100	\N	\N	\N	\N	https://p16-sign-sg.tiktokcdn.com/aweme/1080x1080/tos-alisg-avt-0068/59d51d05e0d3f34b7ae3ca1a77411afc.jpeg?lk3s=a5d48078&nonce=82378&refresh_token=b04334d0898ed261345a446962922b66&x-expires=1725645600&x-signature=E7UZfnNJ6AesLEoKURGB7%2FxnXQE%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-sg.tiktokcdn.com/aweme/720x720/tos-alisg-avt-0068/59d51d05e0d3f34b7ae3ca1a7