7353343961135615278	Shredhappens	\N	CHOPPED EGG SALAD . You already know by now I love quick, easy, and high protein meals. . I also feel egg salad gets a bad rap, but its actually one of my favorite things when done right. . This is a super simple recipe thats low carb, packed with a ton of protein, and it’ll keep you full. Dont like lettuce as the base? Use bell peppers, or your favorite bread - sourdough would be amazing here. . Here is how to make it: . 1.Of course this would be cleaner in a bowl, but lets get messy and chop everything up on a cutting board. We’ll start with 1 medium avocado. Cut in half, scoop out the middle, and toss the seed away. . 2.I medium-boiled 4 eggs for about 9 mins. I just remove them from the fridge, toss in boiling water for 9 mins and 20 seconds. When time is up, just rinse under cold water, and peel them. They should peel super easily. Cut in half, then add to the board with the avocado. . 3.Toss in 1 dill pickle, sliced (about 1/4 cup), 1 small shallot, 1 to 2 tbsp German or brown mustard, 1 to 2 heaping tablespoon cottage cheese, a small handful of fresh dill, a small handful of cilantro, 1 tablespoon mayo, a pinch of salt, pepper. . 4.Chop everything with a knife. If you like it on the chunkier side, chop less. If you like it on the creamier side of things, keep chopping. Then just give it a taste and adjust as you wish. . 5.Pop these onto romaine lettuce leaves, then top with everything bagel and Chile lime seasoning. . ENJOY and follow me for more. . . . . . #lowcarb #lowcarbrecipes #keto #ketorecipes #healthyrecipes #healthyfoodshare #goodmoodfood #whatsonmyplate #saladrecipes		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7353343961135615278.mp4	\N	329700	1494	82800	6900000	\N	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=61433&refresh_token=a1f0318a7c2197690935397f02e8e59f&x-expires=1725728400&x-signature=x3mIiDBdLhUgNy