7359285001281686827	Shredhappens	\N	CHICKEN THAT DOESNT SUCK. This is one of the best 1 pan chicken recipes you’ll make. The secret is the marinate that will elevate the chicken and the quick garlicky herb sauce is unbelievably good!  I’m using bone-in skin-on chicken thighs to make the chicken more flavorful and juicy, but you can remove the skin if you prefer, too. I paired this with a simple salad, but it would be complete with some regular rice, quinoa, or if you’re doing lowcarb/keto, some of my lowcarb @kaizenfoodco rice. . This is how I made it (feel free to multiply for more) . 1.Grab 4 skin-on bone-in chicken thighs, dab them dry with a paper towel and add them to a bowl. . 2.For the marinade, grab a medium mixing bowl. Add 2 tbsp drizzle of olive oil, 2 tbsp tomato paste, 4 minced garlic cloves, the zest and juice of 1 large lemon, a couple generous pinches salt, pepper, 1 tbsp smoked paprika, 1 tbsp oregano or thyme, 1/4 to 1/2 tsp cayenne pepper. Mix it really well. . 3.Add the marinade to the chicken, and mix really well covering all sides. Let this ideally sit for 2 to 6 or ideally, overnight. . 4.Preheat oven to 410F. Remove chicken from fridge and let it come up to room temp before putting in the oven. . 5.Place chicken on a wire rack and put it in the oven at 410F for 35-40 mins. . 6.While thats going, make your sauce. I processed together 3 tablespoons of thick greek yogurt (or labneh), a handful of fresh mint (about 3 tablespoons), 2 scallions (green and white part), 1/2 large jalapeño, 1 tbsp olive oil, the juice of half a lemon, and a couple generous pinches of salt + pepper. Process well, taste, and adjust to your preference. . 7.Remove the chicken from the oven, plate it. Again, you can serve this with whatever base you like (it would be delicious with regular rice, quinoa, or if you’re lowcarb/keto my high protein kaizen rice), some salad of choice, and this sauce. . If you make it, be sure to let me know on SHREDHAPPENS. ENJOY! . . . . #lowcarb #lowcarbrecipes #ketorecipes #keto #chickenrecipes #healthyrecipes #goodmoodfood #healthyfoodshare		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7359285001281686827.mp4	\N	233600	963	45000	5500000	\N	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=65100&refresh_token=e5640d6126c3ca6826ef93d1a892e573&x-expires=1725728400&x-signature=x3mIiDBdLhUgNyL8m4QgtFmfFEM%3D&shp=a5d48078&shcp=b59d6b55	\N	\N	\N	\N	\N	\N	\N	\N	\N
7386307947728506155	Shredhappens	\N	MCHICKEN SHAWARMA SHEET PAN DINNER . If you love quick, easy but super flavorful meals, try making this chicken shawarma sheet pan dinner. Grilled chicken is great, but sometimes you dont feel like firing up the grill and this is an incredible way to put your oven to good use for a ridiculously good meal! I paired this up with some oven roasted grilled onions that were unreal, a delicious cucumber yogurt spread, and side salad. You can serve it over rice, in a pita, or if you are keeping things lowcarb, my high protein lowcarb Kaizen rice. . Here is how to make it: 1.Cut 1.5-2lb boneless skinless chicken thighs into strips or chunks. Place in a large bowl. Drizzle with 1/2 tbsp olive oil, 3 tbsp plain greek yogurt, 2 tbsp tomato paste, juice of 1 large lemon, 6 minced garlic cloves, 1 tbsp thyme or oregano, 1 tbsp sweet paprika, 1/3 tsp cinnamon, 1 tsp cumin, and a couple pinches salt + pepper. . 2.Mix really well and marinate for at least 2-6 hrs, but ideally overnight. This is important! . 3.When you’re ready to eat, remove chicken from fridge and let it sit at room temp for 30 mins. . 4.Preheat oven to 400F. Line a baking tray with parchment paper and add the chicken to the tray, dont overcrowd the tray. Then cut 2 red onions into wedges and toss around the chicken on the tray. Drizzle with more olive oil and sprinkle with about 1/2 tbsp sumac. . 5.Pop into the oven at 400F for 37-40 mins. . 6.Make the cucumber sauce by mixing 3/4 cup plain greek yogurt, 1 Persian cucumber finely diced, 3 tbsp finely chopped fresh dill, 1 small shallot finely shredded/processed, juice of half a lemon, a couple pinches salt & pepper. Mix well. . 7.Remove the sheet pan from the oven, then top with a few dollops of the spread, lots of fresh herbs (parsley, dill, or mint would be great here!), diced cucumber, another dusting of sumac, and fresh lemon juice. . You can eat this as is, with rice, quinoa, or if you want to keep it lowcarb, my lowcarb @kaizenfoodco rice. . ENJOY! . . . . . #lowcarb #lowcarbrecipes #chickenshawarma #keto #ketorecipes #healthyrecipes #healthyfoodshare #goodmoodfood #sheetpandinner 		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7386307947728506155.mp4	\N	20200	130	5039	1100000	\N	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=22287&refresh_token=b90583f7e7a7a1f34c1bd0ff121d43e5&x-expires=1725728400&x-signature=x3mIiDBdLhUgNyL8m4QgtFmfFEM%3D&shp=a5d48078&shcp=b59d6b55	\N	\N	\N	\N	\N	\N	\N	\N	\N
