7183782456355540267	Kayla Lobermeier	\N	English Muffins 🥐 This video is from last summer, right after I had given birth to my third child 💛 I was feeling incredibly vulnerable and inefficient, so I made these muffins and read lots of really sweet comments from our IG community. I thought on would share on this first day of 2023, a time when I felt loved. *This recipe is NOT on my blog* Ingredients: 1 cup warm water 1 tbsp active dry yeast 1 tbsp granulated sugar 3/4 cup whole milk 2 tbsp salted butter 1 tbsp kosher salt 1 large egg 5-6 cups all purpose flour  Cornmeal for dusting Directions: • Combine the water, yeast, and sugar. Let the yeast bloom, about 5 minutes. • Heat the milk and butter over the stove until just warm. Add to the yeast mixture along with the salt and egg. Whisk until combined. Add flour until a soft dough forms that no longer clings to the sides of the bowl. Place in a greased bowl, cover and let rise until doubled, about 1 hour. • Deflate the dough and divide into 12 pieces. Shape into buns and place on baking sheets.  • Cover buns and let rise until puffed, about 35-40 minutes. Preheat the oven to 375 F. • Heat a large skillet over medium-low heat. Melt a pat of butter. Gently roll the buns in a bit of cornmeal to coat both sides. Toast the buns, about 3-4 G at a time, in the pan for about 6-8 minutes on each side. Place the buns on a baking sheet and bake for about 10 minutes or until cooked through the middle.  • Eat fresh or toasted! 💛 #fyp #cottagecore #cottagecorebaking #slowliving #vintageaesthetic #cottagestyledecor #naturecore #fairycore #princesscore #baketok #bakingrecipe #springvibes #vintagelook #breadtok 	fyp, cottagecore, cottagecorebaking, slowliving, vintageaesthetic, cottagestyledecor, naturecore, fairycore, princesscore, baketok, bakingrecipe, springvibes, vintagelook, breadtok	https://my-tiktok-videos-bucket.s3.amazonaws.com/7183782456355540267.mp4	\N	197200	386	2448	2500000	18000	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.