7342084263182863623	Cherie	\N	Welcome to Ep 4 of ✨Salads that DON’T SUCK✨ Today we’re making my fav ever Chinese Cucumber Salad 🥒 This is a classic childhood dish that I grew up eating and it’s by far the tastiest salad ever despite it being so simple.  Traditionally I’d smash the cucumber lengthways then cut it up into rough chunks but recently I’ve been loving the mouthfeel of thin slices instead! Regardless, the dressing stays the same so experiment to see what you prefer.  Ingredients 2 large or 3 medium cucumbers  Approx. 1-2 tsp sea salt 1.5 tbsp black vinegar 1 tbsp soy sauce 1 tsp sesame oil 2 tsp sugar or liquid sweetener of choice  2 cloves garlic, minced  Chilli oil, to taste Pinch of sesame seeds, to garnish  1. Wash your cucumbers then slice off the ends. Thinly slice using a knife of mandolin.  2. Place into a bowl and sprinkle some salt over to draw out any excess moisture. Mix well and set aside for 5 mins. Rinse the cucumber slices well at least 3 times then drain well. Pat dry with a paper towel if needed.  3. Add in the vinegar, soy sauce, sesame oil, sugar, garlic and chilli oil. Toss well to coat.  4. Transfer onto a plate, spoon on the leftover dressing and garnish with sesame seeds and extra chilli oil. Enjoy!  #vegan #plantbased #healthyrecipe #healthyfood #health #saladrecipe #salads #salad #easyrecipe #recipeidea #homemade #cucumber #cucumbersalad #asianrecipe #chinesefood 	vegan, plantbased, healthyrecipe, healthyfood, health, saladrecipe, salads, salad, EasyRecipe, recipeidea, homemade, cucumber, cucumbersalad, asianrecipe, chinesefood	https://my-tiktok-videos-bucket.s3.amazonaws.com/7342084263182863623.mp4	\N	381200	577	23100	7300000	159100	\N	\N	\N	\N	https://p16-sign-sg.tiktokcdn.com/aweme/1080x1080/tos-alisg-avt-0068/02744f890e9639bba16d328c4ea27683.jpeg?lk3s=a5d48078&nonce=22985&refresh_token=a323172ea8927938adce78f2a73428cc&x-expires=1725739200&x-signature=sRrdZXj79OceglNoVzHpjS8VT7w%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-sg