7285765771815390496	Sam Way	\N	Steak & Chips 🥩 Sirloin steak, triple-cooked chips and a brown butter dip 🔥 Recipe: Quantities of ingredients are up to you here, depending on how many you decide serve - there is no set rule of thumb for food like this. - Sirloin steak - Salt - Potatoes (I like to use the maris piper variety for this) - Salt - Vinegar - Vegetable oil - Hollandaise or chimichurri to serve 1. Season the steaks generously with salt then leave to dry brine, uncovered, in the fridge overnight or at least a few hours. 2. Remove the steaks from the fridge and pat dry any excess moisture. Heat a frying pan over a medium-high heat, then add some oil and sear for a few minutes on each side (depending on thickness), until medium-rare (remove at 50 degrees C internal). Leave to rest whilst cooking the chips for their final fry (below). 3. Serve with a brown butter hollandaise or sauce of choice (chimichurri works really well here too). Chips: 1. Peel and cut the potatoes into thick batons then rinse in cold water a few times to remove any excess starch. 2. Place the chips into a pan and cover with cold water. Season with some salt and a splash of vinegar. Bring to to a gentle boil and cook for 10 minutes until just soft, but not falling apart. Remove from the water and lay them onto a cooling rack. 3. Place chips uncovered into the fridge to dry for 1 hour. 4. Heat a heavy based pan, half full with vegetbale oil, to 130 degrees C. Cook the chips for 5 minutes until they form a thin crust. REmove from the oil and place back onto the cooling rack. 5. Place the chips uncovered into the freezer and leave to freeze overnight - they can now be stored in bags until ready to use. 6. To finish the chips, heat vegetable oil back to 180 degrees C and cook for 7-8 minutes until golden & crisp. Sprinkle with sea salt whilst hot and serve. #steak #fries #chips #food #cooking #recipe #asmr #comfortfood #foodtiktok #foodtok #datenight #easyrecipe #tiktokfood #fyp 	steak, fries, 