7411218310022335787	Shredhappens	\N	Buffalo Ranch Chicken & Rice Bowl Makes 4 servings at 460 calories + 40g protein. Plus, this healthier homemade ranch is SO good. . I’ve lost 100lbs by making super flavorful food with lots of protein and lower carb. I used my @kaizenfoodco high protein lowcarb rice here for more protein, but regular rice works too! . Here is how I made it: . 1. Place 4 bone-in skin-on chicken thighs in a bowl. You can use skinless, but I like to keep the skin on during cooking then I remove it before eating. . 2.Drizzle 1 tsp avocado oil & season with a couple pinches of salt & pepper, 1 tbsp dried dill, 1 tbsp onion powder, 1 tbsp garlic powder, 2 tbsp of thick greek yogurt, 1 tbsp apple cider vinegar, & 1/4 cup of your favorite buffalo hot sauce. Mix really well, then for best results let this sit for 2-6 hrs to marinate. Or you can continue if you want to eat right away. . 3.Preheat oven at 425F. Bring chicken out of the fridge and let sit for 30 mins to come up to room temp. Spray a cast iron pan with avocado oil, place the chicken at the base along with 2 quartered shallots and 2 cups broccoli - I used thinly cut broccoli florets sprayed with avocado oil and tossed with pinch of salt, 1 tsp onion powder. . 4.Pop into the oven for 35-38 mins. Time varies by oven and thickness of your chicken. . 5.For the ranch, whisk together 3 tbsp thick yogurt, 3 tbsp mayo, 1/3 cup buttermilk, 2 tbsp apple cider vinegar, juice of 1/2 small lemon, 1 tbsp dried dill, 1/2 tbsp dried oregano, 1 tbsp onion powder, 1/2 tbsp garlic, a pinch of salt, pepper. Shake well, taste, and adjust. I only use 4-6 tbsp of the sauce, so you’ll have plenty leftover! . 6.Make your favorite rice according to instructions. To keep this lowcarb and high protein, I boiled 8oz of my @kaizenfoodco rice. Code Shredhappens always saves you 20%. . 7.Bring skillet out of the oven, top with the cooked rice, drizzle chicken with 4-6 tbsp of the ranch sauce, 1-2 tbsp buffalo sauce, & 1 tbsp 