7241611493962173723	Deliciously Ella	\N	Day 5 of a week of healthy pastas is one of my favourites, creamy red pepper pasta 💕✨ Silky smooth with a gentle kick, this is everything you need on a busy week. It literally takes as long to make the recipe as it does for the pasta takes to boil. I tend to double up the sauce for a simple meal later in the week or freeze the leftovers for another time.    Ingredients (serves 2): - 60g cashews - 2 tablespoons sunflower seeds - 1 red onion, finely chopped - 1 sweet red pepper, finely chopped - pinch flaky sea salt, to taste - 6 cloves of garlic, chopped - 100ml oat/almond milk, (unsweetened) - 1 teaspoon of balsamic vinegar - 2 tablespoons nutritional yeast - 2 heaped teaspoons of harissa paste, plus more for serving (optional) - ½ teaspoon of maple syrup - 1 lemon, juiced - 150g dried pasta Method: 1. Place the cashews and sunflower seeds in a small bowl with 50ml of boiling water, leave to soak for about five minutes or until you blend the sauce. 2. Heat a drizzle of olive oil in a medium saucepan over medium. Add the onion and red pepper and season with a pinch of salt, and cook, stirring occasionally, until softened, about 4 minutes. Add the garlic and cook, stirring often, until fragrant, about 1 minute. 3. Add the onion-red pepper mixture to a high-speed blender along with the oat or almond milk, balsamic vinegar, nutritional yeast, harissa, maple syrup, lemon juice, and the soaked cashews and sunflower seeds, plus their soaking water. Blend until smooth and creamy. Season with salt to taste. 4. When the pasta is cooked, reserve a mugful (start with about 100ml) of the cooking water, stirring it into the sauce. Once it’s nice and glossy, add the pasta to the pan too. Cook together for a minute or so 5. Serve with fresh parsley (optional), several grinds of black pepper, and chilli flakes. #deliciouslyella #healthymealideas #creamypastarecipe #healthymealinspo 	deliciouslyella, healthymealideas, creamypastarecipe, healthy