7403725333029080328	Cherie	\N	Chinese Cucumber Salad 🥒 But the spiral edition 🫢 This is one of my all time fav childhood dishes that I grew up eating and it’s by far one of the most simple yet tastiest salads ever! Of course you can just thinly slice or do the more traditional bash + slice method but the result will still be delicious regardless.  Ingredients 3 medium cucumbers  Sea salt 1.5 tbsp black vinegar 1 tbsp soy sauce 1 tsp sesame oil 2 tsp sugar or sweetener of choice 2 cloves garlic, minced  Chilli oil, to taste Pinch of sesame, to garnish  1. Wash your cucumbers then slice off the ends. Place between a pair of wooden chopsticks and slice in an angle all the way down. Flip and repeat.  2. Put into a bowl and sprinkle some salt over to draw out any excess moisture. Set aside for 5 mins then rinse and drain well. Alternately, you can skip this step and simply marinade your cucumber in the prepared sauce and keep in the fridge until you’re ready to serve.  3. In another bowl, add in the vinegar, soy sauce, sesame oil, sweetener, garlic and chilli oil. Add in the cucumbers and mix well to coat.  4. Transfer onto a plate, spoon on all of the sauce and garnish with sesame seeds and extra chilli oil. Enjoy!  #vegan #plantbased #easyrecipe #recipeidea #homemade #cucumber #salad #asmrfood #healthyrecipe #saladrecipe #healthyfood #cucumbersalad 	vegan, plantbased, EasyRecipe, recipeidea, homemade, cucumber, salad, asmrfood, healthyrecipe, saladrecipe, healthyfood, cucumbersalad	https://my-tiktok-videos-bucket.s3.amazonaws.com/7403725333029080328.mp4	\N	472300	1114	33900	7900000	101500	\N	\N	\N	\N	https://p16-sign-sg.tiktokcdn.com/aweme/1080x1080/tos-alisg-avt-0068/02744f890e9639bba16d328c4ea27683.jpeg?lk3s=a5d48078&nonce=26088&refresh_token=01f9807763d2a640407e23adde22fd3e&x-expires=1725768000&x-signature=x%2FU%2B1IJWT7af02B9G58DB52CWzg%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-sg.tiktokcdn.com/aweme/720x720/tos-alisg-avt-0068/02744f890e9639bba16d328c4ea27683.