7363612629534919969	Giuseppe Healthy	\N	🥔 ROTOLO DI PATATE 2 INGREDIENTI 😋 LOW CARB! Croccante fuori, cremoso dentro… è davvero irresistibile 🤤 Se anche tu ami le patate, questo rotolo non puoi assolutamente non provarlo! FACILISSIMO, light, e super sfizioso! Puoi farcirlo come ho fatto io, o prepararne di mille altre varianti… insomma, lo proverai?? 🤩 Lascia un “MI PIACE” è il tuo modo di dirmi grazie 🙏🏻❤️ 📲 Salva la ricetta  ✌🏻 Seguimi @giuseppe_healthy Ingredienti x 8 porzioni: 2-3 patate 150g formaggio grattugiato Ripieno (facoltativo) 100g formaggio fresco spalmabile  200g prosciutto cotto (o fesa di tacchino)  Procedimento: Lava le patate, pelale e con l’aiuto di una mandolina ricavane delle fette sottili; risciacqua le patate in acqua fredda, fin quando l’acqua non rimarrà trasparente. A questo punto asciuga le patate e forma il tuo rotolo. Su una teglia foderata, fai un primo strato con il formaggio, secondo strato con le patate, terzo strato con il formaggio; schiaccia bene tutti gli strati, in modo tale che il risultato sarà ben compatto. Cuoci in forno preriscaldato ventilato a 180 gradi per 20-30 minuti.   Una volta cotta la base, lasciala intiepidire, ribaltala e farcisci: formaggio spalmabile su tutta la lunghezza e prosciutto! Arrotola su se stesso, ed il gioco è fatto! Non ti resta che tagliare e portare in tavola, credimi, non ne rimarranno neanche le briciole! 🙌🏻🤤 MACROS x 1 porzione (1/8) : 7.8CHO/4.3F/10.7P/ 112cal • • • #rotolo #patate #cheese #senzaglutine #potato #potatoes #ricettefacili #ricettelight #lowcalories #healthyrecipes #recipe #foodporn #healthy #lunch #dinner #cucina #cucinasana #healthylunch #healthydinner #dieta #ricette	rotolo, patate, cheese, senzaglutine, potato, potatoes, ricettefacili, ricettelight, lowcalories, healthyrecipes, Recipe, foodporn, healthy, lunch, dinner, cucina, cucinasana, healthylunch, healthydinner, dieta, ricette	https://my-tiktok-videos-bucket.s3.amazonaws.com/7363612629534919969.mp4	\N	75800	160	21100	30