7256954188716903722	erinliveswhole	\N	MY FAVORITE SALAD EVER ! 🫶🏻 this recipe was based off a basic recipe i got from @giadadelaurentiis but i added my own twist! SO good! 👌🏻  Heat oven to 425. Chop 3 heads broccoli into very small pieces. Place on parchment lined baking sheet. Add 20oz shredded Brussel sprouts to sheet. Drizzle with 2 tbsp olive oil and 1 tsp salt, toss, and bake for 20 minutes, tossing half way through. Let cool. While baking, chop 8 pitted medjool dates and 1 cup salted almonds into small pieces. Set aside. Cook 2lb raw, peeled, tail off shrimp by heating a pan over medium heat. Add 1 tbsp butter and 1 tsp Calabrian chili paste. Add shrimp and a pinch of salt. Cook two minutes per side and turn off heat. Set aside. Make dressing by whisking together 1/2 cup olive oil, 2 tsp Calabrian chili paste, 2 tsp lemon zest, juice of 1 lemon, 2 tbsp honey, 1 tsp salt. Set aside. Assemble salad by putting roasted veggies in bowl, then add shrimp, dates, almonds, and grate fresh pecorino Romano on top. Drizzle dressing evenly over salads. Enjoy! #salad #brusselsprouts #summersalad #shrimp #eathealthy #eatsalad #saladrecipe #summerfood #eathealthyfood #healthysalad #todayfood #eeeeats #foodielife #mealidea #recipeideas 	salad, brusselsprouts, summersalad, shrimp, eathealthy, eatsalad, saladrecipe, summerfood, eathealthyfood, healthysalad, todayfood, eeeeats, foodielife, mealidea, recipeideas	https://my-tiktok-videos-bucket.s3.amazonaws.com/7256954188716903722.mp4	\N	339400	793	35000	9400000	227100	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/7351050888724611115~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=78716&refresh_token=c52c51e6657cf24897d33dd124c904ab&x-expires=1725768000&x-signature=%2FREHBgtasNb5ZBB6ownLrI85Fug%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/7351050888724611115~c5_720x720.jpeg?lk3s=a5d48078&nonce=10056&refresh_token=2f4545ce3c7f4bd79255083aebccf679&x-expires=1725768000&x-signature=WoBEK