7220856271858158854	Emily English	\N	One pan Tuscan baked salmon  This incredibly easy but insanely delicious one pan salmon dish is a midweek winner. Ready in under 15 minutes, it’s creamy but has a light freshness that I think you all will love. It’s hearty enough with the butterbeans but feel free to pair with rice or grain of your choice.  500kcal, 38g protein per portion. You will need to serve 2  2 salmon fillets  1 tin butterbeans  Fresh basil  200g cherry tomatoes  8 sun dried tomatoes, drained from oil and chopped  1 shallot  2 cloves garlic  Few handfuls of spinach  2 tbsp half fat crème fraiche  Smoked paprika  Chicken stock cube  1 lemon  Parmesan  1. Season the salmon fillets with salt and pepper. Sear in a hot pan on all sides until coloured. Remove and set to one side.  2. In the same pan, sweat the shallot and garlic with a pinch of salt. Mix in the whole cherry tomatoes, sun dried, 1/2 tsp smoked paprika and chopped basil stems.  3. Sauté for a few minutes, then add in a stock cube and 200ml water. Bring to a simmer, tip in the butterbeans and leave for 5 minutes.  4. Turn the heat right down, add in 2 tbsp crème fraiche, the zest of a lemon, 15g grated Parmesan and a crack of black pepper. Stir then mix in the spinach and some chopped basil. 5. Place the salmon fillets into the dish and allow to warm through until they are cooked.  6. Serve with extra basil sprinkled over the top and grating of parmesan. #healthymealideas #dinnerideas #healthymeals #mealprep 	healthymealideas, DinnerIdeas, healthymeals, mealprep	https://my-tiktok-videos-bucket.s3.amazonaws.com/7220856271858158854.mp4	\N	52000	183	16600	2700000	52600	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/5f790612f475d215ac636c07465f139d~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=6893&refresh_token=2cf76667334e613bd2a07518f3a4edac&x-expires=1725768000&x-signature=DQn%2B86L83tkBMso7dz4%2F4RuMgns%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/