7390391033999183136	Bored of Lunch	\N	Greek Chicken Bowl 🇬🇷🥗 590 cals a bowl  Honestly hooked on meal prep bowls. With 38g protein, it would make the perfect meal prep or even just dinner with lunch leftovers. Don’t forget to checkout both of my airfryer cookbooks, link in profile.   Marinate your chicken in:   - 5-6 chicken thighs   - 2 tbsp Greek yogurt   - 1 tsp paprika  - 1 tsp thyme  - 1 tsp oregano  - 1 tsp rosemary  - 1 tsp parsley  - 2 crushed garlic cloves  - Juice of ½ lemon  - Salt and pepper  - Olive Oil    Greek salad:  - 1/2 cucumber  - 100g cherry tomatoes  - 75g Feta cheese  - 50g Black olives  - Juice 1/2 lemon  - Fresh mint  - Fresh parsley  - Olive oil  - Salt and pepper    To serve:  Garlic cubed potatoes  Tzatziki (yogurt, fresh mint, squeeze of lemon juice, grated cucumber, salt and pepper)  Hummus (optional)  Toasted pitta bread (optional)     Method:   1. Pop your chicken thighs in a large bowl and add your yogurt, lemon juice and the spices above. Mix through, and let the chicken marinate for at least 4-5 hours, or overnight   2. Once your chicken is marinated, pop your garlic cubed potatoes in the air fryer for 10 minutes at 200, after ten minutes pop your chicken thighs into the air fryer and cook both of them for another 14 minutes at 200  3. While your chicken and potatoes are cooking, prepare your salad by mixing together your tomatoes, cucumber, mint, feta, olives parsley, olive oil and salt and pepper.   4. You can also prepare a super quick tzatziki sauce by mixing together some Greek yoghurt with lemon juice, grated cucumber, fresh mint, salt and pepper.  5. Once the chicken and potatoes are cooked, serve in a bowl alongside the greek salad and tzatziki sauce. You can also choose to serve this with some toasted pittas and hummus if you wish.     Enjoy     #airfryer #airfryerchicken #chicken #chickenrecipes #greek #gyros #gyrobowls #airfryermeals #airfryermealprep #mealprep #mealpreplunch #mealprepdinner #dinner #lunch #lunchideas #l