7367080351337844010	Shredhappens	\N	If you love ridiculously good meals, try this high protein, low carb chicken and rice bowl. The flavors are unbeatable and this is pure muscle fuel! I used my high protein low carb Kaizen rice for this, but it would be great with regular rice, quinoa, or cauliflower rice, too.  . I used bone-in skin-on chicken thighs to make the chicken more flavorful and juicy during the cooking process, but you can always remove the skin if you prefer when it’s made. . This is how I made it: . 1.Grab 4 skin-on bone-in chicken thighs, dab dry with a paper towel and put inside a bowl. . 2.To marinade the chicken, grab a medium mixing bowl. Add 2 tbsp drizzle olive oil, 2 tbsp tomato paste, 4-5 minced garlic cloves, the zest and juice of 1 large lemon, a couple generous pinches salt, fresh cracked pepper, 1 tbsp smoked paprika, 1 tbsp oregano, 1/4-1/2 tsp cayenne pepper. . 3.Add the marinade to the chicken, and mix really well covering all sides of the chicken. Let sit for 2-6 hours or ideally, overnight. . 4.Preheat your oven to 410F. Remove chicken from fridge and let it come up to room temp before putting in oven (this takes about 30 mins) . 5.Place chicken on a wire rack and put it in the oven at 410F for 35-40 mins. . 6.While your chicken is going, make the sauce. I processed 3 tbsp of thick greek yogurt, a handful fresh mint (about 3 tbsp), 2 scallions (green and white part), 1/2 large jalapeño, 1 tbsp olive oil, the juice of half a lemon, and a couple generous pinches of salt + pepper. Process well, taste, and adjust as you like. . 7.For the base, I boiled my @Kaizen Food Company lowcarb rice according to the packaging. Remember, code SHREDHAPPENS saves you 20% on my lowcarb pasta and rice if you order on my site! Its also available on TikTok Shop. It has just 6 net carbs and packs 20g protein. . 8.Plate the chicken with your Kaizen rice, the salad, and sauce! For the salad I diced and mixed 1 tomato, 1/2 onion, 1 jalapeno, fresh cilantro, 1/2 tbsp sumac, salt, a drizzle of olive oil, and lemon juice. . If you make it, be sure to let me know on SHREDHAPPENS. ENJOY! . . . . . #lowcarb #lowcarbrecipes #keto #ketorecipes #healthyrecipes #healthyfoodshare #kaizenrice #proteinrecipes #mealprep	lowcarb, lowcarbrecipes, keto, ketorecipes, healthyrecipes, healthyfoodshare, kaizenrice, proteinrecipes, mealprep	https://my-tiktok-videos-bucket.s3.amazonaws.com/7367080351337844010.mp4	\N	20700	82	3550	899200	20400	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=93997&refresh_token=7f83a80627007d99cc35c073b58ed144&x-expires=1725768000&x-signature=ZrJ9OEkImjqId5x2gcL918o0upk%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_720x720.jpeg?lk3s=a5d48078&nonce=22410&refresh_token=2268859e8291d4217d33b8bb83849e81&x-expires=1725768000&x-signature=NydIorLHQLRUTel1NPEiAUe35ow%3D&shp=a5d48078&shcp=b59d6b55	0	0	0	0	0	0	2024-05-09 19:14:29	\N
