7337502812017823018	Shredhappens	\N	CHIPOTLE CHICKEN & RICE BOWL. . This lowcarb + high protein bowl is going to be one of the BEST meals you’ll make! . I made this HIGH PROTEIN and LOWCARB with my @Kaizen Food Company lowcarb rice. . Here is how I made it: . 1.Add 2 lbs diced chicken brst to a bowl. Drizzle with 1 tbsp olive oil & season with 1 tbsp oregano, 1 tbsp paprika, 1/2 tbsp onion powder, a few pinches of salt + ground pepper. To tenderize & break down the chicken fibers, I added 1/2 teaspoon baking soda. Finally, top with 1.5 tbsp plain yogurt and 2 tbsp of the sauce from a can of adobo chipotle peppers and mix well. Let this sit for 30ish mins before you make it, but if you want to make it right away, go ahead! . 2.When you’re ready to eat, bring a pan to medium heat, add 1 tbsp oil, add chicken, and cook it through on medium heat, stirring every few mins so it cooks on all sides. This takes about 10-12 mins depending on thickness. . 3.Make a simple pico/guac by thinly dicing half a large red onion, a small handful of cherry tomatoes, & a large handful of fresh cilantro. Add to a bowl, sprinkle with salt, ground pepper, and the juice of 1 large lime. Mix well, then let it sit for about 10 mins, stirring it a couple of times. . 4.Make the chipotle crema sauce by mixing 3 tbsp sour cream, 1.5 tbsp mayo, 1 tbsp adobo chipotle sauce from the can, 1 tsp smoked paprika, a pinch of salt, fresh pepper, & juice of 1-2 limes. I like to add more lime to make the sauce lighter, but up to you. . 5.Finally, make your base. To keep this lowcarb, I used my Kaizen lowcarb / keto rice (just 6 net carbs + 20g protein per serving), but you can use rice, cauli rice, quinoa, anything you prefer. I boiled my Kaizen rice for 6 mins and strained it.   6.When rice is cooked, plate it up with your chicken, some of the pico, avocado, and drizzle it up with the sauce. . Remember you can get my Kaizen high protein rice or pasta on my profile right here on tiktok shop or use code TIKTOK to save 20% in the link on my profile. . ENJOY!! . . . #lowcarbrecipes #ketorecipes #ketorice #lowcarb #keto#healthyrecipes #goodmoodfood #tiktokshop 	lowcarbrecipes, ketorecipes, ketorice, lowcarb, keto, healthyrecipes, goodmoodfood, TikTokShop	https://my-tiktok-videos-bucket.s3.amazonaws.com/7337502812017823018.mp4	\N	44500	93	7603	1800000	42600	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=4019&refresh_token=9f50b1c338d0acd19e355653c1d71ae8&x-expires=1725768000&x-signature=ZrJ9OEkImjqId5x2gcL918o0upk%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_720x720.jpeg?lk3s=a5d48078&nonce=82964&refresh_token=e58f6fec5110e0722e33b5bdaeeb563c&x-expires=1725768000&x-signature=NydIorLHQLRUTel1NPEiAUe35ow%3D&shp=a5d48078&shcp=b59d6b55	0	0	0	0	0	0	2024-02-20 02:18:48	\N
