7155207990998584582	Emily English	\N	The Ultimate healthy tuna melt   There is something about a tuna melt that just SLAPS, it is one of my favourite sandwiches and this is my nutritionaifed version with a lighter tuna not mayo mix, and extra virgin olive oil garlic bread.   You will need  1 tin tuna in brine  1 tsp white vinegar  1 tbsp capers, chopped 1 spring onion, chopped 1 heaped tbsp greek yoghurt  1 tsp American mustard  Pinch of salt and pepper 2 slices of bread of choice, I used sourdough. 2 tsp extra virgin olive oil 1 chopped garlic clove  Fresh parsley  50g of cheese of choice, I used taleggio but a good sharp cheddar, gruyere or any cheese of your fancy.   1. Mix the tuna with chopped spring onions, capers, yoghurt, mustard, white vinegar, salt and pepper.  2. Mix the olive oil with finely chopped garlic, parsley and season with salt and pepper. Brush the garlic olive oil over the bread on one side only, flip over and start to fill the bread with the tuna mix. Slice the cheese and lay over the tuna and press the sandwich together.  3. If you have an air fryer, cook at 200c for 3 minutes on each side until golden brown or in a frying pan, cook on a low/medium heat on either side for 4 minutes.  4. Cut in half and dive in, utter heaven. Perfect for dipping… #toastie #healthyrecipes #comfortfood #cosyseason 	toastie, healthyrecipes, comfortfood, cosyseason	https://my-tiktok-videos-bucket.s3.amazonaws.com/7155207990998584582.mp4	\N	103500	279	9441	3700000	59200	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/5f790612f475d215ac636c07465f139d~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=6893&refresh_token=2cf76667334e613bd2a07518f3a4edac&x-expires=1725768000&x-signature=DQn%2B86L83tkBMso7dz4%2F4RuMgns%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/5f790612f475d215ac636c07465f139d~c5_720x720.jpeg?lk3s=a5d48078&nonce=24056&refresh_token=da18173c524379801452f2f6f3fa9f0e&x-expires=1725768000&x-signature=mP4mY4UwP%2