7228337299199724843	Claire Hodgins	\N	Looking for healthy, 30 minute dinner ideas? I’ve got you covered! 🙌😋 Tonight I made grilled chicken, crispy air fried potato wedges and a delicious lemon herb tahini dip… all in 30 minutes! A simple, healthy dinner that the whole family will enjoy 🍽️ Potato wedges: - slice 2 potatoes into wedges - toss in 1/2 tbsp olive oil and 1 tsp salt  - air fry at 375F for 22 minutes, shaking a few times between  Grilled chicken: - slice a chicken breast in half lengthwise  - add to a bowl with 2 tsp olive oil, 1/2 tbsp lemon juice, 1/2 tsp garlic powder, 1/4 salt and a pinch of black pepper - grill for 5-7 mins per side until cooked through Lemon herb tahini dip: - mix together 1/2 cup plain greek yogurt, 2 tbsp tahini, 1 tbsp lemon juice, 1 tsp dried dill, 1 tsp garlic powder, and a pinch of salt  Simple side salad: - add 3 cups spinach, 1/4 of a sliced red onion, 2 tbsp crumbled feta to a bowl - toss with 1 tbsp olive oil, 2 tbsp balsamic vinegar, 1/4 tsp salt and 1/4 tsp red pepper flakes  This recipe makes about 2 servings. I hope you enjoy! 🫶 #healthydinner #easyrecipe #easydinner #familydinner #mealidea #mealinspo #quickdinner #salad #grilledchicken #healthycooking #cleaneating 	healthydinner, EasyRecipe, easydinner, familydinner, mealidea, mealinspo, quickdinner, salad, grilledchicken, healthycooking, cleaneating	https://my-tiktok-videos-bucket.s3.amazonaws.com/7228337299199724843.mp4	\N	428600	568	26600	10500000	202800	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/7342907904217284651~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=88826&refresh_token=1f61356af5dfdb7a74b637675b86e94a&x-expires=1725768000&x-signature=UWa4jDujBFIIu6A9q6u5CsI6cnE%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/7342907904217284651~c5_720x720.jpeg?lk3s=a5d48078&nonce=21216&refresh_token=adb2bc6f1ca20f502d1d6fbe9f2268dc&x-expires=1725768000&x-signature=UFLaRWN%2BIozD9i6t1iuCt%2FB%2B8QU%3D&shp=a5d48078&shcp=b5