7352951455428381958	Jess- Easy healthy recipes	\N	Zucchini Roll-ups!😍 Welcome to episode 1 of Nourish in 30! Have you ever tried zucchini this way? Zucchini roll-ups (also called zucchini involtini) is one of my favourite ways to eat zucchini. Get the full recipe below and also on my blog. Ingredients:  Zucchinis * 4 zucchinis * 1 tbsp olive oil * pinch of salt & pepper Ricotta filling * 1 cup ricotta cheese * 1/4 cup grated parmesan cheese * 1/4 cup chopped basil leaves * 1 garlic clove, minced * salt & pepper to taste * 1 egg Other ingredients * 1 jar of your favourite tomato sauce * 1 cup shredded mozzarella cheese * Fresh basil to garnish Prep the zucchini: Slice the zucchini lengthwise to be 1/4 inch thick, then toss with olive oil, salt and pepper and bake in the oven at 400 degrees F for 10 minutes. Make the filling: Mix the ricotta, parmesan, basil, garlic, salt, pepper and egg together in a bowl until combined. Make the rolls: Fill each slice of zucchini with some stuffing then roll-up. Cover the bottom of an oven-safe pan or baking dish with tomato sauce, then place the zucchini rolls in the pan. Top with a touch more sauce, then top with cheese. Bake: Bake in the oven at 400 degrees F for 8-10 minutes until warmed through and the cheese is melted. Garnish with fresh basil. #zucchini #zucchinirecipes #healthydinner #vegetarianrecipe #glutenfreerecipes #30minutemeals 	zucchini, zucchinirecipes, healthydinner, vegetarianrecipe, glutenfreerecipes, 30minutemeals	https://my-tiktok-videos-bucket.s3.amazonaws.com/7352951455428381958.mp4	\N	223000	443	47100	4400000	142400	\N	\N	\N	\N	https://p77-sign-va.tiktokcdn.com/tos-maliva-avt-0068/39881fb56fe26214201f02be4e99460b~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=67074&refresh_token=600d7d2b8fe7a98c929fbda53607c6e8&x-expires=1725768000&x-signature=bNDvKtlpfhOPecO50QjUgMbZjWw%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/39881fb56fe26214201f02be4e99460b~c5_720x720.jpeg?lk3s=a5d48078&n