7401236799739170078	Healthy Viral Recipes	\N	This delicious and protein packed recipe by: @beeya® is not a want… but a NEED😍 - - Check out their page for more amazing recipes! - - COOKIE DOUGH ICE CREAM SANDWICHES Makes: 6-8 bars Prep Time: 1 hr Freeze Time: 2 hrs Ingredients: Cookie Dough Crust: ✨ 1 cup chickpeas, drained and rinsed ✨ ½ cup natural peanut butter ✨ ⅓ cup maple syrup ✨ ⅓ cup oat flour ✨ ¼ tsp sea salt ✨ 1 tsp vanilla extract ✨ ⅓ cup chopped dark chocolate Vanilla Cream Filling: ✨ 1 ½ cups soaked raw cashews (soaked for 1 hour in hot water or overnight in cold water) ✨ 1 cup coconut cream ✨ 3 Tbsp maple syrup ✨ 1 tsp vanilla bean paste or extract ✨ 1 ½ Tbsp melted coconut oil Instructions: 1️⃣ Dry drained chickpeas and remove majority of skins. 2️⃣ Mix all cookie dough ingredients, except for dark chocolate, in a food processor until smooth. Scrape down as needed. Stir in chopped chocolate. Transfer to a bowl and rest in fridge for 10-15 mins. 3️⃣ To make vanilla filling, drain soaked cashews. Blend all ingredients in a high-speed blender until smooth. 4️⃣ To assemble, line a small loaf tin with parchment paper, divide cookie dough into two equal portions. Press one portion out into one even layer in the bottom of tin. Lift pressed cookie dough out with the parchment paper, cover, and chill in fridge. 5️⃣ Line tin again with new parchment paper. Press other cookie dough portion out in the bottom of tin. Pour vanilla filling into tin, cover and transfer to freezer for 1 hour or until vanilla cream is fairly set. 6️⃣ Once set, place other pressed cookie dough layer on top, then cover and transfer to freezer for another 1 to 2 hours. 7️⃣ To serve, cut into 6-8 bars using a sharp knife while pressing slowly. Store in a container in the freezer for up to 1 month. - - #healthy #sweet #treat #protein #cookie #cookiedough #icecream #sandwich #bars #recipe #healthyrecipe #fyp 	healthy, sweet, treat, protein, cookie, cookiedough, icecream, sandwich, bars, Recip