7406765665433980206	Shredhappens	\N	SPICY SUSHI WRAPS . I absolutely love these sushi wraps - ive made a few different versions and love each one. Theyre perfect for lunch, light dinner, or even a protein-packed snack where you can get a bunch of veggies in. . I didnt use rice to keep it low carb, but if you’re feeling rice, go ahead and fill it up with some regular rice or even my kaizen lowcarb rice. It’s just as good as is! . Here is how I made it: . 1.Steam or cook up 1lb of shrimp and drop in ice water to let cool. Once cooled, finely chop the shrimp and add to a bowl with 2 tbsp mayo, 1 tsp gojuchang or 2 tbsp sriracha, 1.5 tbsp tamari or soy sauce, 1 tbsp rice vinegar, a pinch of salt and fresh pepper. Mix well, then taste & adjust however way you wish. . 3.Grab a flat sushi nori sheet. Grab a pair of scissors and cut halfway down the middle of the sheet. . 4.Fill up each quadrant with the shrimp salad and whatever veggies you like. . 5.I used 3 tbsp of the shrimp, 1/4 avocado sliced, 1 tbsp cream cheese, a few persian cucumber slices, some jalapeno slices, and of course, shredded carrot. . 6.Once each quadrant is filled, fold it up. Start with the bottom left quadrant and fold it up, then across to the right, and finally fold down. . 7.You can eat as is, or spoon some sauce over the top. I made a simple sauce by mixing 2 tbsp mayo, juice of 1/2 lime, 1/2 tbsp gochujang (or 1 tbsp sriracha), and a pinch of salt.. . If you give it a try, let me know what you think. . ENJOY. . . . . . #lowcarb #lowcarbrecipes #sushi #healthyrecipes #goodmoodfood #healthyrecipes #whatsonmyplate #keto #ketorecipes #healthyfoodshare 		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7406765665433980206.mp4	\N	2251	24	431	89400	\N	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=105&refresh_token=6431a3c75a27c3be25cffbefa76b8dec&x-expires=1725814800&x-signature=ohrsU45scBQkYE8%2FmxYRbt