7405847605244071199	RecipesOfTikTok	\N	Baked Apple Fritters 😍 Ingredients: For the Fritters: 3/4 cup all-purpose flour 3/4 cup white whole wheat flour 1/2 cup brown sugar 2 teaspoons baking powder 1 teaspoon cinnamon 1/2 teaspoon nutmeg 1/4 teaspoon allspice 1/4 teaspoon salt 6 tablespoons butter, cold and cut into pieces 1/2 cup milk (the higher the fat content, the richer the flavor) 1 egg 1 teaspoon vanilla extract 1 cup chopped apple For the Glaze: 1 cup confectioner's sugar 2 tablespoons milk (a higher percentage of fat works the best) 1 teaspoon vanilla extract Directions: Preheat your oven to 375°F (190°C) and line a baking sheet with parchment paper. In a large bowl, whisk together the all-purpose flour, white whole wheat flour, brown sugar, baking powder, cinnamon, nutmeg, allspice, and salt. Add the cold, cut butter to the flour mixture. Use a pastry cutter or your fingers to mix until the mixture resembles coarse crumbs. In a separate bowl, whisk together the milk, egg, and vanilla extract. Pour the wet ingredients into the dry ingredients and stir until just combined. Fold in the chopped apple. Drop spoonfuls of the batter onto the prepared baking sheet, shaping them into fritters. Bake for 15-18 minutes, or until the fritters are golden brown and a toothpick inserted into the center comes out clean. While the fritters are baking, prepare the glaze by whisking together the confectioner's sugar, milk, and vanilla extract until smooth. Once the fritters are done, allow them to cool slightly before drizzling with the glaze. Serve warm. #recipesoftiktok #apple #applefritter 	recipesoftiktok, apple, applefritter	https://my-tiktok-videos-bucket.s3.amazonaws.com/7405847605244071199.mp4	\N	34	6	5	892	21	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/1c475f6867e071803672ea6814dd0b34~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=69894&refresh_token=4fc94e2b38d10c0e7aeb575297eb57b6&x-expires=1725814800&x-signature=YaNXhYMs71gyFY108XjEdq5yco0%3D&shp=a5d48