7276269213122104606	HIGHKEITASTY | VIBEY EATS 🥢	\N	Beignets at home ☕️🍴 ________________________________ Ingredients: (makes 35-40 beignets) .  ¾ cup lukewarm water . 1 .25-ounce packet active dry yeast . ½ cup evaporated milk . ⅓ cup sugar . 1/4 tsp salt . 1 egg . 1 tsp vanilla extract . 4 cups all-purpose flour . 3 tbsp melted butter  . Neutral oil (for frying) . powdered sugar (for dusting) ________________________________ Directions: . In a large bowl, combine the water and yeast.  . Let the mixture rest for 5-10 minutes ( should look frothy).  . Whisk in the evaporated milk, sugar, salt, egg, melted butter, and vanilla extract in your the yeast mixture. . Fold in in the flour and continue mixing until well combined. . Pour the dough onto a floured surface and knead for 3-5 minutes. . Place the dough in a greased bowl and cover with a cloth to let rise (in a warm place) for about 2 hours or until doubled in size. . Punch the dough down and remove it from the bowl . Roll out the dough on a floured surface until it is about ¼ – ⅓ inch thick. . Cut the dough into 1 ½ to 2” squares or rectangles with a sharp knife or pizza cutter.  . Let the squares rest for 10 minutes before frying. . Working in batches to not crowd the oil (1-2 pieces at a time), fry the dough squares until puffy and golden brown. ENJOY 🫵🏼 . . . . . . .  #beignets #neworleans #easyrecipe #simplerecipes #foodies #homemade #homemadedessert #fried #friedfood #frieddessert #dough #nyceats  #foodblogger #bakewithme #dessertrecipe #donuts #yummyfood #recipeshare #sweets #dessert #dough #momrecipe #bakingfromscratch #bakingtime #neworleansfood #powdersugar #sugar #sugarhigh #cookingtutorial	beignets, neworleans, EasyRecipe, simplerecipes, foodies, homemade, homemadedessert, fried, friedfood, frieddessert, dough, nyceats, foodblogger, BakeWithMe, dessertrecipe, donuts, yummyfood, recipeshare, sweets, dessert, momrecipe, bakingfromscratch, bakingtime, neworleansfood, powdersugar, sugar, sugarhigh, cookingt