7324782528878087470	Kimber - Easy Recipes	\N	One of the ALL TIME BEST Chicken recipes! These Baked Chicken Bites are so, quick, so easy, and so so so delicious!  I highly recommend the double batch so you can use leftovers for salads, wraps, pastas, or quesadillas for an even EASIER dinner tomorrow night.   Baked Chicken Bites Ingredients  ▢2 pounds boneless skinless chicken breast ▢2 tablespoons olive oil, divided ▢1 tablespoon chicken base ▢1 teaspoon paprika ▢½ teaspoons garlic powder ▢1/2 teaspoon onion powder ▢½ teaspoons black pepper ▢1/4 teaspoon dried thyme Garnish ▢1 tablespoon freshly chopped parsley Instructions  1. Preheat oven to 400˚F. 2. Cut the chicken into bite sized pieces, about 1-2 inch chunks. 3. Place the chicken bites in a 9x13 inch baking dish. Pour 1 tablespoon of the oil and the chicken base over the chicken and toss to coat. 4. Add all of the spices to the chicken and toss them to evenly coat all of the chicken. 5. Bake for 16-20 minutes, or until the internal temperature reaches 165˚F. 6. Once done, allow to sit for 5 minutes then toss the chicken with the chopped parsley and serve. Find the FULL post full of leftover recipe ideas, printable recipe card and nutrition info here >> https://easyfamilyrecipes.com/juicy-oven-baked-chicken-bites/		https://my-tiktok-videos-bucket.s3.amazonaws.com/7324782528878087470.mp4	\N	54800	163	7982	3800000	40200	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/a36c68b93b4b20e718807e85c1da47fb~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=38961&refresh_token=ce219bb9fbc7be7e3dd687199591374c&x-expires=1725814800&x-signature=NHEsVPNVO1HMNCYrXafu7qjz2rA%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/a36c68b93b4b20e718807e85c1da47fb~c5_720x720.jpeg?lk3s=a5d48078&nonce=32927&refresh_token=66d5a9cd459c5e96e5ac0ffd596ef354&x-expires=1725814800&x-signature=qp1FnW636cPN0h%2FIriuh6dgVL40%3D&shp=a5d48078&shcp=b59d6b55	0	0	0	0	0	0	2024-01-16 19:37:31	\N
