7386970127759183137	Xav	\N	WELCOME TO MEDITERRANEAN MADNESS 🍋☀️  my brand new summer series where I’ll be showing you how to make some of the best dishes the Mediterranean has to offer this is part 3 and today were taking a trip to Palestine , to make some Arayes 🇵🇸 this is a wonderful quick, easy and tasty dish to make. You can feel free to use store bought pitas if you want to make this even quicker. I recommend a 20% beef fat mix as this has a lot more flavour, lamb is also super good to replace the beef if you wish! enjoy :) (6) Filling: 500g beef/lamb mince 3 garlic cloves minced 100g finely chopped parsley  1 small brown onion grated/finely diced 1 jalapeno diced 1 tsp ground ginger 1 tsp ground green cardamon 1 tbsp black pepper 1/2 tbsp salt 1 tsp garlic power 1 tsp onion powder 1/2 tsp nutmeg 2 tsp allepo chili pepper 1 tsp smoked paprika 2 tsp extra virgin olive oil Sauce: 200g greek yoghurt 50g chopped parsley 1/2 tsp salt 1 tsp black pepper 1 tbsp extra virgin olive oil 1 garlic clove minced Pita breads (1) Make your filling by combining all the ingredients in a large bowl. Mix well and let rest in the fridge for at least 30 minutes but even better overnight. (2)  Make your dipping sauce by combining all the ingredients in another bowl, mix well and let rest in the fridge for a minimum 30 minutes to allow the flavours to fuse together. (3) Now slice your pita bread in half and gently open them up, fill them up with the mixture then set aside. You will be able to make 6 Arrays with this recipe! Now heat up a grill pan and oil it well, then once very hot, add the arayes one by one and cook for roughly 30 seconds on each side, ensuring you get those grill marks all over. Once seared nicely, remove and place in a preheated oven at 180C and bake for 10 minutes until the meat is fully cooked and the bread is crispy. Serve with the dipping sauce and enjoy ! #arayes #middleeasternfood #mediterraneanfood #fyp 	arayes, middleeasternfood, mediterraneanfood, fyp	htt