7257549104300051738	Jade	\N	These dreamy blueberry cheesecake brioche buns are so decadent and delicious, you’ll fall in love at the first bite I promise you!  These delicious buns are inspired by the Finnish Quark buns called Rahkapulla. However I have no idea what’s quark so I used cream cheese instead. I whipped up the cream cheese with sugar and lemon zest and the entire sweet and tart combo in a fluffy bun is perfect! Sweet Stiff Starter 30g Starter 40g Water 100g Flour 10g Sugar Dough All of Sweet Stiff Starter 250g Bread Flour 2 egg yolks 120g Milk 45g Sugar 4g Salt 45g Butter Cream Cheese Filling 250g Cream Cheese 50g Sugar 15g Corn Flour/ All-Purpose Flour 20g Milk Zest of 1/2 Lemon A pinch of salt (optional) 🅜🅔🅣🅗🅞🅓  1. Knead everything except butter until the dough is strong and fairly elastic. 2. Add the butter in small cubes gradually and knead until window-pane stage.  3. Rest the dough until double.  4. Divide the dough into equal portions of your desired size (mine was 90g) and roll into smooth and tight balls.  Cover and proof until double. 5. Oil the base of a small cup and push it down to compress the middle of each dough ball. 6.Brush the surface of the buns with egg wash  Pipe the cream cheese in the middle of the dough 7.Add your favourite fruit on top of the cream cheese. I used blueberries, other good options would be strawberries and apples 8. Bake in a preheated oven at 185C for 18-20min. The buns will make your kitchen smell incredible! Enjoy the aroma and the delightful  buns! . . . . . #Sourdough#homebaking#homemade#guthealth#instabake#bread#bake#artisanbread#explorepage#learnontiktok#satisfying#fyp#recipes#homecooking#recipereel#naturalfermentation#asmr#satisfying#bakersoftiktok#levain#shebakesourdough#blueberry#cheesecake#brioche#sourdoughstarter#sweetstiffstarter#bakingtipsandtricks#天然酵母#天然酵母パン 	sourdough, homebaking, homemade, guthealth, instabake, bread, bake, artisanbread, explorepage, LearnOnTikTok, satisfying, fyp, recipes, homeco