7315500088552410400	Food with Style	\N	Blueberry Pastry Recipe 🤍 Indulge in the delightful combination of crispy puff pastry, delicate vanilla cream, and luscious blueberries with our Blueberry Pastry 🥰🤍 📝 Ingredients: - 1 sheet puff pastry - 1 egg yolk + 1 tbsp milk (whisked for brushing) For the Vanilla Pudding: - 50 g sugar - 20 g cornstarch - 15 g all-purpose flour - A pinch of salt - 250 ml milk - 3 egg yolks - 1 tsp vanilla extract - 1 tsp butter For the Topping: - Fresh blueberries - Powdered sugar for dusting 🤍 Instructions: 1. Preheat the oven to 190 degrees Celsius. 2. Cut rings from the puff pastry using a pastry cutter. From half of these rings, cut a smaller hole in the center and place them on top of the whole, uncut rings, pressing lightly. 3. Place the rings on a baking sheet lined with parchment paper. Brush the rings with the egg yolk-milk mixture and bake in the preheated oven for approximately 20 minutes until golden brown. Remove from the oven and let them cool completely. 4. Vanilla Pudding :  - Heat the milk in a saucepan.  - In a bowl, mix a bit of milk with egg yolks, sugar, cornstarch, and salt.  - Slowly pour the hot milk into the egg mixture while continuously stirring.  - Pour the mixture back into the saucepan and thicken it over medium heat, stirring constantly. Add vanilla extract.  - Remove the saucepan from the heat, stir in the butter, and let the cream cool, covering it in the process. 7. Fill the cooled pastries with the vanilla Pudding. 8. Decorate with fresh blueberries and dust with powdered sugar. Enjoy these little masterpieces as a dessert or sweet treat! ☺️🤍		https://my-tiktok-videos-bucket.s3.amazonaws.com/7315500088552410400.mp4	\N	100900	370	19400	3100000	64600	\N	\N	\N	\N	https://p16-sign-useast2a.tiktokcdn.com/tos-useast2a-avt-0068-euttp/fdd2ed33e793f09a639d49ddc474a8a1~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=72762&refresh_token=3e229573c1251258b7505b0c17de5584&x-expires=1725818400&x-signature=fjyChxCZe1AtVVuUT5L7s5XkWQ