7273445644172414241	Kookmutsjes	\N	KINDER BUENO COOKIES #kinder #kinderbueno #bueno #cookies #food #recipe #chocolate #fy #fyp #foryou #foryoupage COOKIE DOUGH 150 g Maria biscuits 50 g hazelnuts (chopped and roasted) 150 g unsalted butter   FILLING 250 g mascarpone 250 g hazelnut cream   COATING 400 g milk chocolate 25 ml sunflower oil   GARNISH 50 g dark chocolate   Melt the unsalted butter in a saucepan over low heat.   Place the Maria cookies in a food processor and grind them into fine crumbs.   Combine the finely ground Maria cookies with the chopped hazelnuts and melted unsalted butter in a deep bowl. Mix together until combined.   Spread the cookie dough evenly into a springform pan lined with parchment paper. Press it down firmly using the back of a spoon to make it smooth and even. Place it in the refrigerator for a while.   In a deep bowl, mix the mascarpone and hazelnut cream for 1 minute until smooth.   Spread the hazelnut mixture over the cookie dough and smooth it out evenly. Place it in the freezer to allow the cookie mixture to firm up.   Cut the Bueno cookies into pieces.   Melt the dark chocolate using a double boiler and transfer it into a piping bag.   Melt the milk chocolate together with the sunflower oil using a double boiler. Place the melted milk chocolate in a small, deep bowl.   Dip the Kinder Bueno cookies into the melted chocolate.   Place the Kinder Bueno cookies on a rack lined with parchment paper. Garnish them with lines of dark chocolate.   40 cookies - 1 hour 30 minutes   Tips:   Replace the milk chocolate with your favorite chocolate. I used a springform pan measuring 28x18 cm here.    	kinder, kinderbueno, bueno, cookies, food, Recipe, chocolate, fy, fyp, foryou, foryoupage	https://my-tiktok-videos-bucket.s3.amazonaws.com/7273445644172414241.mp4	\N	111100	554	21300	2300000	49200	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/7342817424461365253~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=6819&refresh_token=b4ce51e98