7242706608935980289	Chiew See	\N	I used to bake more cakes than bread until the pandemic. Time to revisit some old favourites.  Ogura cake hails from Malaysia. It is a very moist and fluffy cake. The method is quite similar to chiffon cake, except it has one extra egg in the yolk batter and it doesn’t need to be inverted during cooling.  The texture of Ogura sits between a JCC (Japanese cottony cheesecake) and Chiffon cake. It is so moist and soft that it can be eaten by itself. ~Ogura Cake~  Yolk batter 5 yolk  1 egg 70g milk 45g oil 100g cake flour Meringue 5 whites 75g sugar 6g lemon juice  ➡️ Mix oil and milk until no strip of oil seen  ➡️ add the sieved cake flour and mix well  ➡️ add 5 yolks and 1 egg and mix well  ➡️ beat egg whites with lemon juice with high speed   add 1/3 sugar when big bubbles seen  ➡️ continue beating and add 1/3 sugar when meringue form finer bubbles  ➡️ add last 1/3 sugar when meringue shows some line while beating   ➡️ beat meringue to firm/medium peak  ➡️ fold 1/3 of meringue to the yolk batter   ➡️ pour back the batter to the balance meringue and fold well  ➡️ pour in 18cmx18cm square pan (line bottom and lightly grease the side)   ➡️ bake at 150C for 1hr 15-30mins with water bath (bain-marie) method   ➡️ remove cake from oven and demould right away  #ogura #oguracake #softcake #cake #fluffycake #相思蛋糕 #spongecake #chiffoncake #waterbath #bainmarie #steambake	ogura, oguracake, softcake, cake, fluffycake, 相思蛋糕, spongecake, chiffoncake, waterbath, bainmarie, steambake	https://my-tiktok-videos-bucket.s3.amazonaws.com/7242706608935980289.mp4	\N	843000	2758	55600	15800000	195100	\N	\N	\N	\N	https://p16-sign-useast2a.tiktokcdn.com/tos-useast2a-avt-0068-giso/66ffc31fbadae101396ada3c2a70d602~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=97346&refresh_token=54c4a8503773811ebd4654c657242fdd&x-expires=1725818400&x-signature=2PeUGygPwgCYX7yK%2Fepct3vSiWs%3D&shp=a5d48078&shcp=b59d6b55	https://p16-sign-useast2a.tiktokcdn.com/tos-useast2a-avt-0068-giso/66f