7406037591310601514	Shredhappens	\N	VIRAL MARRY ME CHICKEN - BUT CHOPPED SALAD FORM! . You already know about Marry Me Chicken, but lets make a quick, easy, high protein, and lowcarb chopped salad for an easy but ridiculously good meal. I used lots of fresh basil, sundried tomato, perfectly spiced chicken, and a ridiculously good lemony sundried tomato-y sauce with Avocado oil mayo as the base. I used @Chosen Foods Classic Mayo made with avocado oil - it’s got simple ingredients and made from 100% pure avocado oil unlike other options. Plus, it contains good fats, and you know I’m all about eating good fats to stay full + satiated. . Here is how to make it: . 1.Start by seasoning 2 chicken breasts. Drizzle with 1 tbsp Chosen Foods Avocado Oil, a couple pinches salt, fresh cracked pepper, 1 tbsp onion powder, 1 tbsp garlic powder, 1 tbsp sweet paprika, 1/2 tbsp thyme, and 1/2 tsp cayenne pepper. Mix well, ensuring all sides of chicken are covered thoroughly.. . 2.Get a pan on medium heat, add the chicken and cook for 3 mins on first side and flip, cook for 7 mins on 2nd side, both times with lid on. Take off heat & let rest for 10-15 mins if you want a warm chicken salad, or cool completely if you want a cold chicken salad. . 3.Now, the Marry Me Sauce! Grab a small food processor. Add ⅓ to ½ Chosen Foods Avocado Oil mayo, 1 tsp dijon mustard, 2 fresh garlic cloves, ¼ cup sundried tomatoes, zest of 1 lemon, the juice of 2 large lemons, 3 tbsp freshly shredded parm cheese, a generous pinch of salt, pepper, and ½ tsp smoked paprika. Process well, taste & adjust. . 4.Now grab a large cutting board. Add a large handful of spinach to the base, a handful of fresh basil, add the chicken, ½ red onion, the cooked chicken, ¼ cup sundried tomato, some shredded parmesan cheese, and the sauce. . 5.Chop everything very well - make it chunky or more finely chopped as you wish. . 6.Scoop over your fav bread, pita, tortilla, or lettuce boats or bell peppers for the perfect lowcarb lunch. . ENJOY! . .. #ChosenPartner #lowcarbrecipes #lowcarb #keto #ketorecipes #healthyrecipes #healthyfoodshare #eggsalad #goodmoodfood #chickensalad		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7406037591310601514.mp4	\N	5660	53	1024	152900	\N	\N	\N	\N	\N	https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/9fee72b7e9cd9274049d34052184abbd~c5_1080x1080.jpeg?lk3s=a5d48078&nonce=247&refresh_token=df0ac8a2c3f0f5c03453de15a88c5de2&x-expires=1725822000&x-signature=2m2BU2XRwCrDDauF3vqhpMC3ffE%3D&shp=a5d48078&shcp=b59d6b55	\N	\N	\N	\N	\N	\N	\N	\N	\N
7411599123692014891	Shredhappens	\N	Middle eastern wraps  . If you love delicious flavor packed protein, these kaftas are IT! And pair so perfectly with the halloumi, yogurt sauce, and accompaniments here. To keep this lowcarb, I used a lowcarb pita as the base, but you can use any kind of pita or lavash. Then topped it with a cucumber dill yogurt dip, added the koftas, added grilled halloumi cheese - my favorite - and topped it off with some red onion, parsley, cucumber, & a dusting of sumac. . Here is how I made it: . 1.First, the kaftas.Grab a food processor, pulse together 1/3 red onion, 4-6 cloves garlic, 1/3 cup pistachios, and a large handful fresh parsley. Pulse well. Then add 2lbs ground beef (or mixture of beef/lamb) to a bowl. Top it with the processed marinate. Add a couple pinches salt, 1tbsp smoked paprika, tsp cumin, 2 tbsp sumac, ground pepper, & mix well. Cover and let it marinate for 30 mins, but ideally 2-4 hrs . 2.When you’re ready to make them, roll them in logs, patties, or whatever shape you like. You can grill these or if you dont have one, pan fry them on medium-high heat. Time depends on thickness. . 3.For the yogurt sauce, I mixed 3/4 cup thick Greek yogurt with salt, pepper, juice of 1/2 small lemon, 1-2 minced/grated garlic cloves, 2 tbsp fresh dill, & 1 shredded persian cucumber. Give it a taste & adjust. . 4.Lastly, cut halloumi cheese into thin slices and grill until golden brown on both sides on a pan on medium heat. . 5.Pull it all together by adding 2 tbsp of the yogurt sauce, 2-3 kaftas, 2 slices halloumi, thinly diced red onion & cucumber, fresh parsley, & sumac over your pita of choice. . ENJOY! If you make it, be sure to let me know on SHREDHAPPENS . . . . #lowcarb #lowcarbrecipes #keto #ketorecipes #healthyrecipes #middleeasternfood #mediterraneanfood #healthyfoodshare  #goodmoodfood #whatsonmyplate		https://my-tiktok-videos-bucket.s3.us-east-2.amazonaws.com/7411599123692014891.mp4	\N	392	13	64	7623	\N	\N	\N	\N	\N	https://p16-